import React from 'react'
import './Items.css'
    const Items = (props) => {
    return (
        <div className='items'>
            <Link></Link><img src={props.image} alt={props.name} />
            <p>{props.name}</p>
            <div className="items-price">
                <div className="item-price-new">
                    ${props.new_price}
                </div>
                <div className="item-price-old">
                    ${props.old_price}
                </div>
            </div>
        </div>
    )
}

export default Items
